import React, { useEffect } from "react";
import { getAllWorkshop } from "../../Helpers/Workshop";

export const UnAuthHome = () => {
  useEffect(() => {
    getAllWorkshop().then().catch();
  }, []);

  return <div>
    <h1>Hi, this is un auth screen</h1>
  </div>;
};
